import React, { useState } from 'react';
import { Card } from 'primereact/card';
import { InputText } from 'primereact/inputtext';
import { InputNumber } from 'primereact/inputnumber';
import { InputTextarea } from 'primereact/inputtextarea';
import { Calendar } from 'primereact/calendar';
import { Button } from 'primereact/button';
import { Message } from 'primereact/message';
import { Dropdown } from 'primereact/dropdown';
import { invoiceAPI } from '../services/api';

const CreateInvoice: React.FC = () => {
  const [clientName, setClientName] = useState('');
  const [clientEmail, setClientEmail] = useState('');
  const [amount, setAmount] = useState<number | null>(null);
  const [description, setDescription] = useState('');
  const [dueDate, setDueDate] = useState<Date | null>(null);
  const [paymentMethod, setPaymentMethod] = useState('');
  const [loading, setLoading] = useState(false);
  const [success, setSuccess] = useState('');
  const [error, setError] = useState('');

  const paymentMethods = [
    { label: 'Payoneer', value: 'Payoneer' },
    { label: 'Western Union', value: 'Western Union' }
  ];

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    setLoading(true);

    try {
      await invoiceAPI.createInvoice({
        clientName,
        clientEmail,
        amount,
        description,
        dueDate,
        paymentMethod
      });

      setSuccess('Faktura je uspešno kreirana!');
      // Reset form
      setClientName('');
      setClientEmail('');
      setAmount(null);
      setDescription('');
      setDueDate(null);
      setPaymentMethod('');
    } catch (error: any) {
      setError(error.response?.data?.message || 'Greška pri kreiranju fakture');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Card title="Kreiraj novu fakturu" className="w-full">
      <form onSubmit={handleSubmit}>
        <div className="grid">
          <div className="col-12 md:col-6">
            <div className="field">
              <label htmlFor="clientName" className="block mb-2">Ime klijenta</label>
              <InputText
                id="clientName"
                value={clientName}
                onChange={(e) => setClientName(e.target.value)}
                className="w-full"
                required
              />
            </div>
          </div>

          <div className="col-12 md:col-6">
            <div className="field">
              <label htmlFor="clientEmail" className="block mb-2">Email klijenta</label>
              <InputText
                id="clientEmail"
                type="email"
                value={clientEmail}
                onChange={(e) => setClientEmail(e.target.value)}
                className="w-full"
                required
              />
            </div>
          </div>

          <div className="col-12 md:col-6">
            <div className="field">
              <label htmlFor="amount" className="block mb-2">Iznos (RSD)</label>
              <InputNumber
                id="amount"
                value={amount}
                onValueChange={(e) => setAmount(e.value || null)}
                className="w-full"
                mode="currency"
                currency="RSD"
                locale="sr-RS"
                required
              />
            </div>
          </div>

          <div className="col-12 md:col-6">
            <div className="field">
              <label htmlFor="dueDate" className="block mb-2">Datum dospijeća</label>
              <Calendar
                id="dueDate"
                value={dueDate}
                onChange={(e) => setDueDate(e.value as Date)}
                className="w-full"
                required
                showIcon
              />
            </div>
          </div>

          <div className="col-12">
            <div className="field">
              <label htmlFor="description" className="block mb-2">Opis</label>
              <InputTextarea
                id="description"
                value={description}
                onChange={(e: React.ChangeEvent<HTMLTextAreaElement>) => setDescription(e.target.value)}
                className="w-full"
                rows={3}
                required
              />
            </div>
          </div>

          <div className="col-12">
            <div className="field">
              <label htmlFor="paymentMethod" className="block mb-2">Preporučeni način plaćanja</label>
              <Dropdown
                id="paymentMethod"
                value={paymentMethod}
                options={paymentMethods}
                onChange={(e) => setPaymentMethod(e.value)}
                className="w-full"
                placeholder="Izaberite način plaćanja"
              />
            </div>
          </div>
        </div>

        {error && (
          <Message severity="error" text={error} className="mb-3" />
        )}

        {success && (
          <Message severity="success" text={success} className="mb-3" />
        )}

        <div className="flex justify-content-end">
          <Button
            type="submit"
            label="Kreiraj fakturu"
            icon="pi pi-plus"
            loading={loading}
          />
        </div>
      </form>
    </Card>
  );
};

export default CreateInvoice;
